import { Link, NavLink } from "react-router-dom";
import FooterIcon from "./common/footerIcon";

const Footer = () => {
   return (
      <div
         id="footer"
         className="d-flex
          justify-content-center gap-5 m-0 border-top py-2 text-center bg-light"
      >
         <FooterIcon
            title="Favorites"
            href="/favorite-cards"
            bsColorWhenActive="danger"
            icon="heart"
         />
         <Link className="d-flex flex-column text-black-50 text-decoration-none">
            <i className="bi bi-heart-fill fs-3 "></i>
            <span>Favorites</span>
         </Link>
         <Link className="d-flex flex-column text-black-50 text-decoration-none">
            <i className="bi bi-heart-fill fs-3 "></i>
            <span>Favorites</span>
         </Link>
      </div>
   );
};

export default Footer;
